import React from 'react';

class Disease extends React.Component{
    constructor(props){
        super(props);
        console.log(props.currentDiseases);
    }
    render(){
        function makeDiseaseDetail(details,name){
            console.log('make disease detail: ',details);
            return <div>
                Disease Name: {name}<br/>
                Medications: <br/>
                <ul>
                    {details['medications'].map(e=><li key={e}>{e}</li>)}
                </ul>
                Things to Avoid: <br/>
                <ul>
                    {details['avoid'].map(e=><li key={e}>{e}</li>)}
                </ul>
            </div>;
        }
        var disList=[];
        for(var key in this.props.currentDiseases){
            disList.push(key);
        }
        var medHistory=disList.map(dis=><li key={dis}>{makeDiseaseDetail(this.props.currentDiseases,dis)}</li>);
        return medHistory;
    }
}
export default Disease;
